Ciao a tutti cerco persone per scalare in Platino  . Uso skype TS Voice RK. Main jungler ma gioco anche mid ad carry e top volendo.
Cerco ragazzi che non prendono fuoco dopo una kill subita, e non flammino pesante, meglio, se non flammino proprio, anche perche non ci aiuta a vincere la partita. Che sanno usare almeno qualche campione e mainarlo bene e che non vanno a regalare kill facili in giro. Nessuno ha mai vinto tutte le partite ma mettendo impegno e bravura si ottiene tanto. Gioco solitamente di sera. Se siete interessati postate il nick sotto oppure aggiungetemi nel game. Grazie e buona caccia .
